CREATE DEFINER=`root`@`localhost` PROCEDURE `sexCount` ()  BEGIN

DROP TABLE tmp_count_sex;

CREATE TABLE tmp_count_sex as (	
			SELECT 
		year(drowning_date) y
		,count(if(sex = 'ชาย',1,null)) m
		,count(if(sex <> 'ชาย',1,null)) f
		from report_dead 
		where drowning_after_dead <> 'ไม่เสียชีวิต' 
		and national = 'ไทย'  and age< 15
		GROUP BY y

);

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `timeCount` ()  BEGIN
	DROP TABLE tmp_count_month;
	CREATE TABLE tmp_count_month as (
	  
			SELECT 
				year(drowning_date) as y,
				month(drowning_date) as m,
				COUNT(id) n 
				from report_dead 
				where 
				drowning_after_dead <> 'ไม่เสียชีวิต' 
				and national = 'ไทย'  and age< 15
			GROUP BY y,m
	
	);
	

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `typeCount` ()  BEGIN
	DROP TABLE tmp_count_type;
	
	CREATE TABLE tmp_count_type as (	
	
						SELECT 
			year(drowning_date) y
			,drowning_type t
			,count(drowning_type) n

			from report_dead 
			where drowning_after_dead <> 'ไม่เสียชีวิต' 
			and national = 'ไทย'  and age< 15
			GROUP BY y,t
	
	);
	
	
END$$

CREATE DEFINER=`sa`@`%` PROCEDURE `updateAgeNull` ()  BEGIN
 
 UPDATE report_dead t SET t.age = 0  WHERE t.age is null;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `update_rate_changwat` ()  BEGIN
	
	DROP TABLE tmp_rate_changwat;
	CREATE TABLE tmp_rate_changwat as (
	
				SELECT tt.*,round(tt.dead*100000/tt.pop,2)as rate from (
			SELECT year(t.drowning_date) dyear
			,t.drowning_province changwatcode
			,count(t.id) dead 

			,(
				SELECT sum(p.pop_male + p.pop_female)  from population_base p 
				where p.changwatcode = t.drowning_province 
			) pop 

			from report_dead t

			where t.drowning_after_dead <> 'ไม่เสียชีวิต' and t.national = 'ไทย'
			GROUP BY dyear,changwatcode
			)   tt
	
	);
	

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `update_report_dead` ()  BEGIN

	UPDATE report_dead t set t.s_year = YEAR(t.drowning_date);

END$$

