ีลักษณะผิวหนังซีด- เขียวไม่หายใจจึงได้ตัดสินใจ  นำเด็กส่ง  รพ.ทุ่งเสลี่ยมด้วยตนเองทันทีด้วยความเป็นห่วงเด็ก และถึงตึกอุบัติเหตุ รพ.ทุ่งเสลี่ยมเวลาประมาณ  11.00  น.    หลังจากนั้นทีมสอบสวนสวนโรคได้ลงไปที่บ้านของเด็กที่จมน้ำในเวลาต่อมา ที่บ้านเลขที่  40 หมู่ 1  ตำบลทุ่งเสลี่ยม  จากการสอบถามพบว่า  เด็กอาศัยอยู่กับ  ปู่กับย่า มีพี่น้อง  2  คน พ่อแม่แยกทางกันบิดาทำงานที่  กทม.มีภรรยาใหม่   เด็กหญิงเป็นผู้พี่ชื่อเล่น  ชื่อ ด.ญ โต๋ อายุ 9 ปีเรียนอยู่ชั้นประถมที่ 3  ( ตกน้ำ ) และน้องชายชื่อ.เต๋า.เรียนอยู่ชั้นประถมที่ 1 อายุ 7  ปี และมีเด็กอีก 2 คนที่ไปเล่นน้ำด้วยกันเป็นเพื่อนบ้านอยู่ระแวกเดียวกัน   คนที่ 3 เด็กชื่อ กร ชื่อเล่น อยู่ชั้นอนุบาล 2  (ตกน้ำ )  ระหว่างลงสอบสวนโรคทราบว่าญาติติดตามเด็กไปที่  รพ.ศรีสังวรทั้งหมด   บิดา-มารดาทราบข่าวแล้วกำลังเดินทางมาจากที่ทำงาน จังหวัดเชียงใหม่  คนที่ 4 ชื่อ อาร์ท เพศชายเรียนอยู่อนุบาล 2  เช่นเดียวกัน   เด็กทั้ง 4  คนเรียนอยู่โรงเรียนอนุบาลเหมืองนา  จากการสอบถาม ปู่-ย่า ของเด็กทั้ง 2 คนทราบว่าเด็กทั้ง 4 คนดังกล่าวมาเล่นด้วยกันที่บ้านทุกวันเพราะเป็นช่วงปิดเทอม  วันที่เกิดเหตุ  เวลาประมาณ 10.00 น.ก็เห็นเด็กมาเล่นกันที่บ้านเหมือนเคยทุกวันแต่ไม่ทราบว่าเด็กไปเล่นน้ำบริเวณฝาย   จนถึงเวลาประมาณ  11.20 น.มีผู้มาแจ้งว่าหลานตกน้ำ  จากการสอบถาม เด็กชาย.เต๋า..ซึ่งเป็นน้องชายของเด็กผู้หญิง เด็กพูดเก่งมาก สามารถเล่าถึงเหตุการณ์ที่เกิดขึ้นได้อย่างเข้าใจตามประสาเด็กจากการสอบถาม เด็กเล่าให้ฟังว่าทั้ง  4 คนก็มาเล่นที่บ้านตนเองตามปกติทุกวันหลังจากนั้นก็ได้ชักกันไปเล่นน้ำที่ฝายกั้นน้ำดังกล่าว เด็กบอกว่าไปเล่นทุกวัน ไปบ่อย  วันที่เกิดเหตุหลังจากเล่นที่บ้านแล้วรู้สึกร้อนก็ไปเล่นน้ำบริเวณดังกล่าวอีก   ไปเล่นประมาณ   10.00  น. ( จากการสอบถาม ปู- ย่า บอกว่าไม่เห็นเด็กตอนนั้น ) เด็กเล่าต่อหลังจากเล่นไปสักพักหนึ่ง เด็กผู้หญิงได้ลงไปเล่นน้ำยังจุดที่ตกน้ำ  เด็กเล่าว่าพี่ผู้หญิงของตนเอง เดินลงไปจากจุดที่เล่นกันเพราะอยากรู้ว่าน้ำลึกขนาดไหน และได้พลัดตกน้ำไปแล้วร้องบอกว่าช่วยด้วยอยู่สักพักหนึ่ง  หลังจากนั้นเด็กชาย กร ก็ได้โดดลงไปช่วยเด็กผู้หญิงและได้พลัดตกไปอีก 1 คน   หลังจากนั้นเด็กทั้ง 2 คน จึงได้วิ่งมาตามคนเพื่อให้ช่วยเหลือดังกล่าว   ระยะจากจุดที่เด็กตกน้ำบริเวณฝายกั้นน้ำ กับบ้านผลเมืองดี  100  เมตร  จากการประเมินเบื้องต้นคร่าวๆเวลาที่เด็กตก และได้รับการช่วยเหลือขึ้นจากน้ำจนสามารถส่งถึงโรงพยาบาลน่าจะใช้เวลา   10 -15 นาที  ', 'มี', 'ป้ายคำเตือนและแกลลอนผูกเชือก', 'นายสุขสันต์       คงประจักษ์', '', 'งานควบคุมโรค โรงพยาบาลทุ่งเสลี่ยม', '64', '', '', '2018-04-24', '2018-11-11', NULL, NULL, NULL, NULL, NULL, '2018', ''),
