น   หลังจากนั้นเด็กทั้ง 2 คน จึงได้วิ่งมาตามคนเพื่อให้ช่วยเหลือดังกล่าว   ระยะจากจุดที่เด็กตกน้ำบริเวณฝายกั้นน้ำ กับบ้านผลเมืองดี  100  เมตร  จากการประเมินเบื้องต้นคร่าวๆเวลาที่เด็กตก และได้รับการช่วยเหลือขึ้นจากน้ำจนสามารถส่งถึงโรงพยาบาลน่าจะใช้เวลา   10 -15 นาที  ', 'มี', 'ป้ายคำเตือนและแกลลอนผูกเชือก', 'นายสุขสันต์       คงประจักษ์', '', 'โรงพยาบาลทุ่งเสลี่ยม', '64', '', '', '2018-04-24', '2018-11-11', NULL, NULL, NULL, NULL, NULL, '2018', ''),
