(17, NULL, 'W74', '2018-06-03', '15:00:00', '2018-06-03', 'ด.ช.', 'สิริภพ', 'เขียวสุข', 'ชาย', 'ตามบัตรประชาชน', '', NULL, '65', '6501', '650101', 0, 11, 'ไทย', 'ว่ายน้ำไม่เป็น', 'อ่างเก็บน้ำ', '>10', '', '', 'uploads/pic_20181111011253.jpg', 'uploads/thumbnail/pictmp_20181111011253.jpg', 'อ่างเก็บน้ำแก่งไฮ อ.นครไทย จ.พิษณุโลก', '65', '6502', '650201', 'มี', 'เสื้อชูชีพ', 'พ่อแม่', 'ญาติ', 2, 1, NULL, '', 'ห่วงยาง(เป็ด)พลิกคว่ำ', 'ไม่ใช่', 'ไม่ใช่', 'ไม่ใช่', 'ไม่ใช่', 'ใช่', 'ไม่ใช่', '', 'ไม่ใช่', '', '>1000', 'ไม่มี', '', '', 'เสียชีวิต ณ ที่', 'นำศพขึ้นมาจากน้ำ', '', 'ไม่ได้ปฐมพยาบาล', 'เสียชีวิตแล้ว', '', 'เจ้าหน้าที่อาสาสมัคกู้ภัย', 'นำส่งสถานบริการสาธารณสุข', 'โรงพยาบาลนครไทย', 'เวลาเกิดเหตุ ประมาณ 15.00 น. ขระที่ครอบครัวเด็กลงเล่นน้ำในแก่งไฮ จำนวน 7 คน ซึ่งผู้ประสบเหตุลงเล่นด้วย โดยมีเสื้อชูชีพ (Size S) ซึ่งใหญ่เกินไปสำหรับผู้เสียชีวิต มารดาจึงให้สวมห่วงยางชูชีพที่แขน 2 ข้างแทน แต่ผู้ประสบเหตุร้องไม่ยอมสวมใส่ จึงลงเล่นน้ำในห่วงยางเป็ดโดยไม่สวมเสื้อชูชีพและห่วงยางแขน ขณะนั้นเพื่อนบางคนแกล้งจมน้ำและเพื่อนๆ กระโดดลงไปช่วย คนดูแลที่ช่วยประคองการเล่นน้ำของผู้ประสบเหตุตกใจจึงปล่อยมือจากห่วงยางๆ จึงพลิกคว่ำ ทำให้ผู้ประสบเหตุจมน้ำซึ่งพยายามจับตัวผู้ประสบเหตุแต่ไม่ทันจึงเรียกคนขับเรือและพลเมืองดีมาช่วยแต่ไม่สามารถฉวยร่างของผู้ประสบเหตุได้ จึงแจ้ง 1669 ขอทีมจากรพร.นครไทยและชุดประดาน้ำของมูลนิธิประสาทบุญสถาน ใช้เวลาดำน้ำประมาณ 20 นาทีจึงพบร่างผู้ประสบเหตุและนำส่ง รพร.นครไทยต่อไป', 'มี', 'กำหนดมาตรการป้องกันในแหล่งน้ำท่องเที่ยวเพิ่มเติม', 'นายอันเชิญ ขันติ', 'นักวิชาการสาธารณสุขชำนาญการ', 'สสอ.นครไทย', '65', '881646523', '', '2018-06-04', '2018-11-11', NULL, NULL, NULL, NULL, NULL, '2018', ''),
