(23, NULL, 'W74', '2018-06-23', '14:00:00', '2018-06-23', 'ด.ช.', 'ธนาคาร', 'กาบพิรมย์', 'ชาย', 'ตามบัตรประชาชน', '6', 1, '67', '6707', '670708', 10, NULL, 'ไทย', 'ว่ายน้ำไม่เป็น', 'คลอง', '1.8', '', '', 'uploads/pic_20181021090101.png', NULL, 'คลองท้ายอ่างเก็บน้ำลำกง หมู่ 4 ต.ท่าวังดี ', '67', '6707', '670708', 'ไม่มี', '', 'ปู่ย่าตายาย', 'ญาติ', 1, 1, NULL, 'เล่นน้ำ', '', 'ไม่ใช่', 'ไม่ใช่', 'ไม่ใช่', 'ไม่ใช่', 'ใช่', 'ไม่ใช่', '', 'ไม่ใช่', '', '>1000', 'ไม่มี', '', '', '', 'นำศพขึ้นมาจากน้ำ', '', 'ทำการปฐมพยาบาล', '', 'CPR', 'เจ้าหน้าที่อาสาสมัคกู้ภัย', 'นำส่งสถานบริการสาธารณสุข', 'โรงพยาบาลหนองไผ่', 'เด็กชายอายุ7ปีเป็นบุตรคนเดียวอาศัยอยู่กับตายาย พ่อแม่ไปทำงานที่ กทม. อาศัยอยู่ที่หมู่บ้านวังท่าดีเลขที่ 6 หมู่ 1 ซึ่งอยู่ห่างจากอ่างเก็บน้ำประมาณ1 กม. ยายพาหลานกับลูกพี่ลูกน้องกันไปเล่นน้ำที่คลองระบายน้ำจากอ่างเก็บน้ำเป็นทางยาวคล้ายน้ำตกน้ำไหลแรงไม่ลึก แต่มารวมตรงแอ่งก่อนระบายออกไปบริเวณแอ่งจึงลึกตั้งแต่เวลา11.00 น.จนเวลาประมาณบ่ายโมงกว่าป้าอีกคนชวนยายไปงมหอยที่แพตรงเขื่อนซึ่งไปอีกประมาณ3กม.และให้หลานเล่นอยู่กับเพื่อนๆโดยมีห่วงยางเกาะอยู่ซึ่งบริเวณนั้นมีคนเยอะแม่ค้าขายของและคนเล่นน้ำเต็มไปหมดจนเด็กหายไปจึงเริ่มหากันและลงไปงมในก้นแอ่ง 1669 แจ้งเหตุมาที่รพ.หนองไผ่เวลา 14.00น. รถถึงที่เกิดเหตุเวลา18.18น.พบนำเด็กขึ้นมาไว้บนแคร่แล้วไม่มีชีพจรตัวซีดเขียวคนที่มุงอยู่บอกว่านำเด็กขึ้นมาแล้วอาสามูลนิธิร่มโพธิ์ที่มาเที่ยวบริเวณนั้นช่วยทำCPRแต่เด็กไม่ฟื้นขณะรถโรงพยาบาลไปถึงยายก็มาจากที่งมหอยพร้อมกันซึ่งหลานเสียชีวิตแล้วจึงมาที่โรงพยาบาลพร้อมกันขณะนำส่งโรงพยาบาลก็ทำ CPR มาตลอดทางจนถึงโรงพยาบาลแต่เด็กเสียชีวิตแล้วจึงแจ้งร้อยเวรชันสูตรพร้อมแพทย์ที่โรงพยาบาลเวลา15.30 น.  ญาติไม่ติดใจในสาเหตุการตาย จึงได้มอบศพให้ญาตินำศพไปจัดการตามประเพณี', 'ไม่มี', '', 'นางสาวดารา สวัสดิ์นะที', 'พยาบาลวิชาชีพชำนาญการ', 'โรงพยาบาลหนองไผ่', '67', '818876420', '56782100', '2018-06-26', '2018-11-11', NULL, NULL, NULL, NULL, NULL, '2018', ''),
