(26, NULL, 'W74', '2018-09-15', '17:00:00', '2018-09-15', 'ด.ช.', 'รอติดตาม', 'รอติดตาม', 'ชาย', 'ตามบัตรประชาชน', '', NULL, '67', '6706', '670601', 4, NULL, 'ไทย', 'ว่ายน้ำไม่เป็น', 'ท่อระบายน้ำ', '', '', '', 'uploads/pic_20181111015321.jpg', 'uploads/thumbnail/pictmp_20181111015321.jpg', 'ท่อลอดใต้ถนน ริมถนนหมายเลข 2245(น้ำท่วมขังริมถนน) บริเวณหน้าวัดโคกสะแกลาด', '67', '6706', '670601', 'ไม่มี', '', 'พ่อแม่', 'พี่ น้อง', 2, 1, NULL, 'เล่นน้ำ', '', 'ไม่ใช่', 'ไม่ใช่', 'ไม่ใช่', 'ไม่ใช่', 'ใช่', 'ไม่ใช่', '', 'ไม่ใช่', '', '', 'ไม่มี', '', '', 'เสียชีวิต ณ ที่', 'นำศพขึ้นมาจากน้ำ', '', 'ไม่ได้ปฐมพยาบาล', 'เสียชีวิตแล้ว', '', '', 'นำส่งสถานบริการสาธารณสุข', 'โรงพยาบาลศรีเทพ', 'ผู้ประสบเหตุเล่นน้ำท่วมขังกับลูกพี่ลูกน้องริมทางถนนหมายเลข 2245 บริเวณหน้าวัดโคกสะแกลาด ต.ศรีเทพ และถูกดูดลงไปในท่อลอดใต้ถนนข้ามไปอีกฝั่งหนึ่งซึ่งเชื่อมต่อลงลำคลอง ที่เกิดเหตุมีลักษณะเป็นทางริมถนนมีน้ำท่วมขังกระแสน้ำไหลแรง', 'ไม่มี', '', 'ทดสอบ', 'ทดสอบ', 'โรงพยาบาลศรีเทพ', '67', '', '', '2018-09-15', '2018-11-11', NULL, NULL, NULL, NULL, NULL, '2018', ''),
(27, NULL, 'W74', '2018-04-11', '15:30:00', '2018-04-11', 'ด.ญ.', 'จิดาภา', 'จันโสดา', 'หญิง', 'ตามบัตรประชาชน', '25', 1, '53', '5305', '530504', 12, NULL, 'ไทย', 'ว่ายน้ำไม่เป็น', 'แม่น้ำ', '3', '', '', 'uploads/pic_20181021094040.png', NULL, 'แม่น้ำปาดท้ายหมู่บ้าน ', '53', '5305', '530504', 'ไม่มี', '', 'ญาติ', 'ญาติ', 1, 1, NULL, 'พลัดตกหกล้ม', '', 'ไม่ใช่', 'ไม่ใช่', 'ไม่ใช่', 'ไม่ใช่', 'ใช่', 'ไม่ใช่', '', 'ไม่ใช่', '', '500', 'ไม่มี', '', '', 'เสียชีวิต ณ ที่', 'ช่วยด้วยการหาอุปกรณ์โยนให้จับ', 'ไม้', 'ทำการปฐมพยาบาล', '', 'cprmouth', 'เจ้าหน้าที่พยาบาล (กู้ชีพ)', 'นำส่งสถานบริการสาธารณสุข', 'โรงพยาบาลฟากท่่า', 'ในวันที่เกิดเหตุ เป็นวันหยุดช่วงปิดเทอม  ตรงกับวันพุธที่ ๑๑ เมษายน ๒๕๖๑ เวลาประมาณ ๑๔.๓๐ น. อากาศร้อนอบอ้าว ผู้เสียชีวิตกับครอบครัวของน้าชาย  รวม ๕ คน (น้าชาย  น้าสะใภ้ ลูกชาย ลูกสาว และผู้ตาย) ได้พากันไปเล่นน้ำ โดยให้เด็ก ๓ คน ลงเล่นน้ำ ส่วนน้าชายกับน้าสะใภ้นั่งรออยู่บนฝั่ง ปกติผู้เสียชีวิตว่ายน้ำไม่เป็น เวลาประมาณ ๑๕.๐๐ น. ผู้ตายได้ลื่นพลัดลงไปในกลางแม่น้ำจุดที่ลึก มีอาการตะเกียกตะกาย ผลุบโผล่อยู่ในน้ำ ทีแรกน้าชายคิดว่าผู้ตายว่ายน้ำและดำน้ำเล่น ต่อมาเมื่อผู้ตายไม่โผล่ขึ้นมาอีก น้าชายได้ลงไปช่วยในน้ำโดยคว้าได้ผมผู้ตายแต่แล้วก็หลุดมือจมลงไปในจุดที่ลึก (ผู้ตายมีร่างกายสูงใหญ่) ประกอบกับน้าชายว่ายน้ำไม่เก่ง เมื่อช่วยไม่สำเร็จ จึงได้โทรแจ้งและตามพ่อแม่ผู้ตายและญาติที่อยู่ในบ้านไปช่วย  และขณะนั้นญาติได้โทรแจ้งรถฉุกเฉินขององค์การบริหารส่วนตำบลสองห้อง ชาวบ้านได้พยายามช่วยกันค้นหาใช้เวลาประมาณ ๑๕ นาที จึงพบร่างผู้ตายซึ่งหมดสติและหยุดหายใจแล้ว ได้นำขึ้นจากน้ำมาบนฝั่ง ได้นำร่างผู้ตายส่งโรงพยาบาลฟากท่าโดยรถฉุกเฉินขององค์การบริหารส่วนตำบลสองห้อง (ระหว่างนำร่างขึ้นจากน้ำและนำส่งโรงพยาบาลนั้น เจ้าหน้าที่ได้ทำการช่วยฟื้นคืนชีพด้วยการนวดหัวใจตลอดเวลาการเดินทาง จนถึงโรงพยาบาลฟากท่า ) เวลาประมาณ ๑๕.๔๕ น. คณะแพทย์และพยาบาลได้ทำการช่วยฟื้นคืนชีพต่อ จนกระทั่งเวลา ๑๖.๓๐ น. ร่างกายผู้ตายยังไม่ตอบสนองใดๆ  ไม่มีสัญญาณชีพ  แพทย์วินิจฉัยว่า ผู้ป่วยได้เสียชีวิตแล้ว และได้ยุติการช่วยฟื้นคืนชีพ', 'ไม่มี', 'แจ้งเตือน', 'นายณรงค์ เปลี่ยนทัศน์(และทีม)', 'นักวิชาการสาธารณสุขชำนาญการ', 'รพ.สต.สองห้อง', '53', '', '', '2018-04-11', '2018-11-11', NULL, NULL, NULL, NULL, NULL, '2018', ''),
